The quality of these episodes vary, but this torrent contains every episode, including the pilot episode &quot;Chicken from Outer Space&quot;

Also included is an ssa file containing subtitles for the &quot;Freaky Fred&quot; episode in season one. This was just something I put together for myself and it not perfect. This file is not important at all, I just didn&amp;#039;t want to delete it when creating the torrent.

The only thing missing are the music specials from season three entitled &quot;The Wind Whispers Courage&quot; and &quot;They Must be Giants&quot; both of which originally aired on 8/23/2002. If anyone can find these files, or if files of better quality are found, please let me know.
